import React from 'react';
import {Nav, Navbar,Form,FormControl,Button} from 'react-bootstrap';
import { FiBookmark } from 'react-icons/fi'
import styled from 'styled-components';
// import NavbarToggle from 'react-bootstrap/NavbarToggle';
import NavbarCollapse from 'react-bootstrap/NavbarCollapse';

const Styles = styled.div`
    // .navbar {
    //     background-color: #222;
    // }

    // .navbar-brand, .navbar-nav .nav-link {
    //     color: #bbb;
    //     &:hover {
    //         color:white;
    //     }
    // }

    // .ml-auto {
    //     position:fixed;
    //     left:0;
    // }
`;

// a functional component returns a react element
export const NavigationBar = () => (
    <Styles>
        <Navbar classname="navbar" collapseOnSelect bg="primary" variant="dark" fixed="top" expand="sm">
            <Form inline>
                    <FormControl type="text" placeholder="Enter keyword" className="input-search" />
                    {/* <Button type="submit">Submit</Button> */}
            </Form>
            <Navbar.Toggle aria-controls="responsive-navbar-nav" className="justify-content-end"/>
            <NavbarCollapse id='responsive-navbar-nav'>
                <Nav className='ml-auto justify-content-center'>
                    <Nav.Item><Nav.Link href="/">Home</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/world">World</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/politics">Politics</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/business">Business</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/technology">Technology</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="/sports">Sports</Nav.Link></Nav.Item>
                    <Nav.Item><Nav.Link href="#"> <FiBookmark /> </Nav.Link></Nav.Item>
                </Nav>
            </NavbarCollapse>
        </Navbar>
    </Styles>
)
